import { useEffect, useState } from "react";
import { useTrafficStore } from "../../store/useTrafficStore";
import styles from "../TrafficUpdates/TrafficUpdates.module.css";

type CardProps = {
  title: string;
};

const TrafficUpdates = ({ title }: CardProps) => {
  const { trafficUpdates, fetchTrafficUpdates } = useTrafficStore();

  useEffect(() => {
    fetchTrafficUpdates();
  }, []);

  return (
    <div>
      <h2>{title}</h2>
      {trafficUpdates.length > 0 ? (
        <div className={`${styles.container} bg-green-500 text-white p-2 rounded-2xl`}>
          {trafficUpdates.map((update, index) => (
            <div key={index} className="bg-gray-400 p-2 grid gap-2 grid-cols-2">
            <div class="bg-teal-400">
            <p>{update.Message}</p>
            <p>{update.RoadNumber}</p>
            <p>{update.SeverityText}</p>
              <p>{update.CreationTime}</p>
              <p>{update.LocationDescriptor}</p>
            </div>
            <div class="bg-teal-400">Two</div>
          </div>
          ))}
        </div>
      ) : (
        <p>No traffic updates available.</p>
      )}
    </div>
  );
};

export default TrafficUpdates;
